    false,nt"url": null,nt"notes": "The purpose of this project was to determine
    and evaluate sources of geothermal energy at two military bases in southern California,
    the Long Beach Naval Shipyard and Naval Station and the Seal Beach Naval Weapons
    Station.One part of the project focused on the natural geothermal characteristics
    beneath the naval bases. Another part focused on the geothermal energy produced
    by oilfield operations on and adjacent to each base. Results of the study are presented
    here for the U.S. Department of the Navy to use in its program to reduce its reliance
    on petroleum by the development of different sources of energy. The study was accomplished
    under a cooperative agreement between the U.S. Department of Energy's San Francisco
    Operations Office and the Department of the Navy's Naval Weapons Center, China Lake,
    California, for joint research and development of geothermal energy at military
    installations.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
